(() => {
  function createCometExplosionAnimation({
    ctx,
    canvas,
    startX,
    startY,
    endX,
    endY,
    startTime,
    scale = 1,
  }) {
    const duration = 800;
    const explosionDuration = 1000;

    const SCALE = scale;

    const img = new Image();
    // NOTE! This is a long one, which might be clipped, atleast on VSCode display.
    img.src =
      "data:image/png;base64,";
    let imgLoaded = false;
    img.onload = () => {
      imgLoaded = true;
    };
    img.onerror = () => {
      console.error("Image failed to load");
    };

    // Trace configuration: 3 lines beside the flying bottle
    const numTraces = 3;
    const traceSpacing = 20 * SCALE; // Horizontal spacing between trace lines.
    const traceHistory = []; // History of main dot position for drawing traces.
    const maxHistoryLength = 15; // Maximum history length to draw.

    return (now) => {
      const elapsed = now - startTime;
      const flightProgress = Math.min(elapsed / duration, 1);

      ctx.clearRect(0, 0, canvas.width, canvas.height);

      // ---- flight phase ----
      if (flightProgress < 1) {
        const mainX = startX + (endX - startX) * flightProgress;
        const mainY = startY + (endY - startY) * flightProgress;

        // Add parabolic curve (arc) for visual motion effect
        const curveMagnitude = 100 * SCALE; // Maximum curve height.
        const arcY = -curveMagnitude * Math.sin(flightProgress * Math.PI); // Parabolic curve (0 at start/end, max at middle).

        const bottleX = mainX;
        const bottleY = mainY + arcY;

        // Record position history for traces
        traceHistory.push({ x: bottleX, y: bottleY });
        if (traceHistory.length > maxHistoryLength) {
          traceHistory.shift(); // Keep history size manageable.
        }

        // Draw trace lines beside the main bottle path
        // Use a delay so the traces follow a position behind the image
        const traceDelay = 6;
        for (let traceIndex = 0; traceIndex < numTraces; traceIndex++) {
          const offset =
            (traceIndex - Math.floor(numTraces / 2)) * traceSpacing;
          for (let i = 1 + traceDelay; i < traceHistory.length; i++) {
            const alpha = (i / traceHistory.length) * 0.7;
            ctx.strokeStyle = `rgba(180, 220, 255, ${alpha})`;
            ctx.lineWidth = 3 * SCALE;
            ctx.lineCap = "round";
            ctx.beginPath();
            ctx.moveTo(
              traceHistory[i - 1 - traceDelay].x + offset,
              traceHistory[i - 1 - traceDelay].y,
            );
            ctx.lineTo(
              traceHistory[i - traceDelay].x + offset,
              traceHistory[i - traceDelay].y,
            );
            ctx.stroke();
          }
        }

        // Draw the main image with rotation
        if (imgLoaded) {
          const angle = Math.atan2(
            bottleY -
              (traceHistory.length > 1
                ? traceHistory[traceHistory.length - 2].y
                : startY),
            bottleX -
              (traceHistory.length > 1
                ? traceHistory[traceHistory.length - 2].x
                : startX),
          );

          // 32 is the base size, 12 is the growth during flight. Increase 32 for a larger image, 12 for more growth.
          const imgSize = (32 + flightProgress * 12) * SCALE;

          ctx.save();
          ctx.translate(bottleX, bottleY);
          ctx.rotate(angle);
          ctx.drawImage(img, -imgSize / 2, -imgSize / 2, imgSize, imgSize);
          ctx.restore();
        } else {
          // fallback: draw dot if image not loaded
          const dotRadius = (4 + flightProgress * 2) * SCALE;
          const dotGradient = ctx.createRadialGradient(
            bottleX,
            bottleY,
            0,
            bottleX,
            bottleY,
            dotRadius + 4 * SCALE,
          );
          dotGradient.addColorStop(0, "rgba(255, 255, 255, 1)");
          dotGradient.addColorStop(0.5, "rgba(180, 220, 255, 0.8)");
          dotGradient.addColorStop(1, "rgba(180, 220, 255, 0.2)");
          ctx.fillStyle = dotGradient;
          ctx.beginPath();
          ctx.arc(bottleX, bottleY, dotRadius + 4 * SCALE, 0, Math.PI * 2);
          ctx.fill();
        }

        return true;
      }

      // ---- explosion phase ----
      const explosionElapsed = elapsed - duration;
      const explosionProgress = Math.min(
        explosionElapsed / explosionDuration,
        1,
      );

      // Draw the bottle at the final position for the duration of the explosion, minus the last 20% for natural look
      if (imgLoaded && explosionProgress < 0.8) {
        // Calculate the angle at the end of the flight
        let angle = 0;
        if (traceHistory.length > 1) {
          const last = traceHistory[traceHistory.length - 1];
          const prev = traceHistory[traceHistory.length - 2];
          angle = Math.atan2(last.y - prev.y, last.x - prev.x);
        }
        const imgSize = 44 * SCALE;
        ctx.save();
        ctx.translate(endX, endY);
        ctx.rotate(angle);
        ctx.drawImage(img, -imgSize / 2, -imgSize / 2, imgSize, imgSize);
        ctx.restore();
      }

      // Water-like waves explosion effect
      const offsetY = 10 * SCALE; // Places waves bit below to look more natural
      const numWaves = 2;
      const maxRadiusX = 100 * SCALE; // Horizontal stretch
      const maxRadiusY = 18 * SCALE; // Vertical stretch
      const minRadiusX = 15 * SCALE;
      const minRadiusY = 6 * SCALE;
      const baseAlpha = 0.7;
      const waveDelayStep = 0.23;
      const waveProgressArr = [];
      for (let i = 0; i < numWaves; i++) {
        const waveDelay = i * waveDelayStep;
        let waveProgress = (explosionProgress - waveDelay) / (1 - waveDelay);
        waveProgress = Math.max(0, Math.min(1, waveProgress));
        waveProgressArr.push(waveProgress);
        if (waveProgress === 0) continue;

        const rx = minRadiusX + (maxRadiusX - minRadiusX) * waveProgress;
        const ry = minRadiusY + (maxRadiusY - minRadiusY) * waveProgress;
        const waveAlpha =
          baseAlpha * (1 - waveProgress) * (0.8 + 0.2 * Math.random());
        const startAngle = Math.PI * (0.1 + 0.7 * Math.random());
        const endAngle = startAngle + Math.PI * (1.3 + 0.5 * Math.random());

        // Pirate rum color gradient (amber/gold to brown)
        const grad = ctx.createLinearGradient(endX - rx, endY, endX + rx, endY);
        grad.addColorStop(0, "rgba(255, 210, 120, 0.7)");
        grad.addColorStop(0.5, "rgba(180, 120, 40, 0.85)");
        grad.addColorStop(1, "rgba(120, 70, 20, 0.5)");

        // Fillment: fill a semi-transparent ellipse inside the wave
        ctx.save();
        ctx.globalAlpha = 0.75 * (1 - waveProgress);
        ctx.fillStyle = "rgba(180, 120, 40, 0.35)";
        ctx.beginPath();
        ctx.ellipse(
          endX,
          endY + offsetY,
          rx * 0.98,
          ry * 0.98,
          0,
          0,
          Math.PI * 2,
        );
        ctx.fill();
        ctx.restore();

        ctx.save();
        ctx.globalAlpha = waveAlpha;
        ctx.strokeStyle = grad;
        ctx.lineWidth = 3 * (1 - waveProgress) * SCALE + 3 * SCALE;
        ctx.beginPath();
        ctx.ellipse(endX, endY + offsetY, rx, ry, 0, startAngle, endAngle);
        ctx.stroke();
        ctx.restore();
      }

      return explosionProgress < 1;
    };
  }

  // ---------- demo runner ----------
  // This section sets up a demo to run the animation on a canvas element.

  const canvas = document.createElement("canvas");
  canvas.width = Math.min(window.innerWidth, 900);
  canvas.height = Math.min(window.innerHeight, 500);

  canvas.style.cssText = `
    position: fixed;
    left: 16px;
    bottom: 16px;
    z-index: 999999;
    border-radius: 12px;
    background: rgba(0,0,0,.65);
    backdrop-filter: blur(2px);
    box-shadow: 0 12px 40px rgba(0,0,0,.35);
  `;

  document.body.appendChild(canvas);

  const ctx = canvas.getContext("2d");

  function runOnce(endX, endY) {
    const startX = 40;
    const startY = canvas.height - 40;

    const scale = Math.max(0.8, Math.min(2, canvas.width / 700));

    const startTime = performance.now();
    const tick = createCometExplosionAnimation({
      ctx,
      canvas,
      startX,
      startY,
      endX,
      endY,
      startTime,
      scale,
    });

    let rafId = 0;
    const loop = (now) => {
      const alive = tick(now);
      if (alive) rafId = requestAnimationFrame(loop);
    };
    rafId = requestAnimationFrame(loop);

    return () => cancelAnimationFrame(rafId);
  }

  let stopCurrent = runOnce(canvas.width * 0.8, canvas.height * 0.3);

  const onClick = (e) => {
    const rect = canvas.getBoundingClientRect();
    const x = (e.clientX - rect.left) * (canvas.width / rect.width);
    const y = (e.clientY - rect.top) * (canvas.height / rect.height);

    stopCurrent?.();
    stopCurrent = runOnce(x, y);
  };

  canvas.addEventListener("click", onClick);

  window.__COMET_DEMO__ = {
    stop() {
      stopCurrent?.();
    },
    destroy() {
      stopCurrent?.();
      canvas.removeEventListener("click", onClick);
      canvas.remove();
      delete window.__COMET_DEMO__;
    },
    rerun() {
      stopCurrent?.();
      stopCurrent = runOnce(canvas.width * 0.8, canvas.height * 0.3);
    },
  };

  console.log(
    " Comet demo started. Click the canvas to aim. Controls: __COMET_DEMO__.stop(), __COMET_DEMO__.rerun(), __COMET_DEMO__.destroy()",
  );
})();
